import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams, useNavigate } from 'react-router-dom';

function UploadDocument() {
  const [file, setFile] = useState(null);
  const [uploadStatus, setUploadStatus] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [progress, setProgress] = useState(0);
  const [documents, setDocuments] = useState([]);
  const { source } = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    console.log(`Attempting to connect to WebSocket: ws://127.0.0.1:8001/ws/documents/${source}/`);
    const socket = new WebSocket(`ws://127.0.0.1:8001/ws/documents/${source}/`);

    socket.onopen = () => {
      console.log('WebSocket connection established');
    };

    socket.onmessage = (event) => {
      console.log('WebSocket message received:', event.data);
      const data = JSON.parse(event.data);
      if (data.message) {
        setUploadStatus(data.message.status);
        setProgress(data.message.progress);
        if (data.message.status === 'success') {
          console.log('Upload successful, fetching documents...');
          fetchDocuments();
        }
      }
    };

    socket.onerror = (error) => {
      console.error('WebSocket error:', error);
    };

    socket.onclose = (event) => {
      console.log('WebSocket connection closed:', event);
    };

    return () => {
      console.log('Closing WebSocket connection');
      socket.close();
    };
  }, [source]);

  const fetchDocuments = async () => {
    try {
      console.log(`Fetching documents for source: ${source}`);
      const response = await axios.get(`/get-documents/${source}/`);
      console.log('Fetched documents:', response.data);
      setDocuments(response.data.documents);
    } catch (error) {
      console.error('Error fetching documents:', error);
      setUploadStatus('Error fetching documents');
    }
  };

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    if (!file) {
      alert('Please select a file to upload');
      return;
    }

    setIsLoading(true);
    setUploadStatus('Initiating upload...');
    setProgress(10);
    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await axios.post(`/upload-document/${source}/`, formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
          'X-CSRFToken': getCookie('csrftoken'),
        },
        withCredentials: true,
      });

      console.log('Upload response:', response.data);

      if (response.data.status === 'success') {
        setUploadStatus('File upload initiated. Processing...');
        // Don't navigate away immediately, wait for WebSocket message
      } else {
        setUploadStatus('Unexpected response. Please check the server logs.');
        setProgress(0);
      }
    } catch (error) {
      console.error('Error uploading document:', error);
      setUploadStatus('Error: ' + (error.response?.data?.message || error.message || 'Unknown error occurred'));
      setProgress(0);
    } finally {
      setIsLoading(false);
    }
  };

  const getCookie = (name) => {
    let cookieValue = null;
    if (document.cookie && document.cookie !== '') {
      const cookies = document.cookie.split(';');
      for (let i = 0; i < cookies.length; i++) {
        const cookie = cookies[i].trim();
        if (cookie.substring(0, name.length + 1) === (name + '=')) {
          cookieValue = decodeURIComponent(cookie.substring(name.length + 1));
          break;
        }
      }
    }
    return cookieValue;
  };

  return (
    <div>
      <h2>Upload Document to {source}</h2>
      <form onSubmit={handleUpload}>
        <input type="file" onChange={handleFileChange} />
        <button type="submit" disabled={isLoading}>Upload</button>
      </form>
      <div>
        <p>Status: {uploadStatus}</p>
        <p>Progress: {progress}%</p>
      </div>
      <div>
        <h3>Documents:</h3>
        <ul>
          {documents.map((doc, index) => (
            <li key={index}>{doc.name || doc.id}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default UploadDocument;
